Dolyna Raion (Ukrainian: Доли́нський райо́н, romanized: Dolynśkyi rajon) was a raion (administrative district) of Ivano-Frankivsk Oblast of Ukraine. The city of Dolyna was the administrative center of the raion. The raion was abolished on 18 July 2020 as part of the administrative reform of Ukraine, which reduced the number of raions of Ivano-Frankivsk Oblast Oblast to six. The area of Dolyna Raion was merged into Kalush Raion. The last estimate of the raion population was 68,266 (2020 est.).
The raion was located in the historical land of Boyko people.
At the time of disestablishment, the raion consisted of three hromadas:
Dolyna urban hromada with the administration in Dolyna;
Vyhoda settlement hromada with the administration in the urban-type settlement of Vyhoda;
Vytvytsia rural hromada with the administration in the selo of Vytvytsia.

During the Soviet period, the high authority in the oblast was shared between three persons: The first secretary of the Lipetsk CPSU Committee (who in reality had the biggest authority), the chairman of the oblast Soviet (legislative power), and the chairman of the oblast Executive Committee (executive power). Since 1991, CPSU lost all the power, and the head of the Oblast administration, and eventually the governor was appointed/elected alongside elected regional parliament.
The Charter of Lipetsk Oblast is the fundamental law of the region. The current charter was adopted on 27 March, 2003. The Lipetsk Oblast Council of Deputies is the province's standing legislative (representative) body. The Council of Deputies consists of 56 deputies elected for a five-year term by the Oblast's inhabitants and exercises its authority by passing laws, resolutions, and other legal acts and by supervising the implementation and observance of the laws and other legal acts passed by it. The current head of the Council of Deputies is Pavel Putilin.
The highest executive body is the Oblast Government, which includes territorial executive bodies such as district administrations, committees, and commissions that facilitate development and run the day to day matters of the province. The Oblast administration supports the activities of the Governor who is the highest official, who is elected by the Oblast's inhabitants for a five year term and acts as guarantor of the observance of the oblast Charter in accordance with the Constitution of Russia.
Since 2019, the Governor is Igor Artamonov.
Representatives of the Lipetsk Oblast in the Federation Council of the Federal Assembly of the Russian Federation are:

Maksim Kavdzharadze — a representative of the legislative (representative) body of state power of the Lipetsk Oblast;
Oksana Khlyakina — representative from the executive body of state power of the Lipetsk Oblast.Representatives of the Lipetsk Oblast in the State Duma of the Federal Assembly of the Russian Federation are:

Nikolay Bortsov (United Russia);
Mikhail Tarasenko (United Russia);
Darya Lukina (United Russia);
Mikhail Gulevsky (United Russia).

The duchy was named after the town of Geldern (Gelder) in present-day Germany. Though the present province of Gelderland (English also Guelders) in the Netherlands occupies most of the area, the former duchy also comprised parts of the present Dutch province of Limburg as well as those territories in the present-day German state of North Rhine-Westphalia that were acquired by Prussia in 1713.
Four parts of the duchy had their own centres, as they were separated by rivers:

the quarter of Roermond, also called Upper Quarter or Upper Guelders – upstream on both sides of the Maas, comprising the town of Geldern as well as Erkelenz, Goch, Nieuwstadt, Venlo and Straelen;spatially separated from the Lower Quarters (Gelderland):

the quarter of the county Zutphen, also called the Achterhoek – east of the IJssel and north of the Rhine, including Doesburg, Doetinchem, Groenlo and Lochem;
the Veluwe Quarter with Arnhem as its capital – west of the IJssel and north of the Rhine, with Elburg, Harderwijk, Hattem and Wageningen;
Nijmegen Quarter, including Betuwe – south of the Rhine and north of the Maas (in between the rivers), including Gendt, Maasbommel, Tiel and Zaltbommel
